import React, { Component } from 'react';
import axios from "axios";
import {Link} from "react-router-dom";
import DAL from "../DALUtils";


class StageOne extends Component {
    constructor(props){
        super(props);
        this.state={isNameVaild:true ,objData:{}};
    }


    componentDidMount(){

    }

    getFormData=(e)=> {
        console.log('in get form data');
        e.preventDefault();
        var fname = e.target['fname'].value;
        var lname = e.target['lname'].value;
        if (fname != null && fname.length > 0 ) {
            this.setState({});
            objData = {
                'name': fname,
                'last name': lname,
            };

        }else{
            this.setState({isNameVaild: false});
        }
    };

    render() {
        var nameEerrMsg;
        if(!this.state.isNameVaild){
            nameEerrMsg = 'name is mandatory'
        }
        return (
            <div className="">
                <h1>Register</h1>
                <form onSubmit={this.getFormData}>
                    First Name<input type='text' name='fname'/><br/>
                    {nameEerrMsg}<br/>
                    Last Name<input type='text' name='lname'/><br/>
                    <Link to='/stage2' type='submit'>Next</Link>
                </form>

            </div>
        );
    }
}

export default StageOne;
